import styled from "styled-components";

export const Container = styled.div`
    position: absolute;
    display: flex;
    align-items: center;

    left: 0;   
    width: 50px;
    height: 80%;
    padding: 0 50px;

    background: ${props => props.theme.colors.primary};
    color: ${props => props.theme.colors.text};    
`;
